#include <iostream>
#include <vector>
#include <set>
#include <algorithm>

using namespace std;

int main() {
    vector<vector<int>> A(3, vector<int>(3));
    for (int i = 0; i < 3; i++) {
        for (int j = 0; j < 3; j++) {
            cin >> A[i][j];
        }
    }
    int N;
    cin >> N;
    set<int> b;
    for (int i = 0; i < N; i++) {
        int x;
        cin >> x;
        b.insert(x);
    }

    bool bingo = false;
    // Check rows
    for (int i = 0; i < 3; i++) {
        set<int> row;
        for (int j = 0; j < 3; j++) {
            row.insert(A[i][j]);
        }
        if (row.size() == b.size()) {
            bingo = true;
            break;
        }
    }

    // Check columns
    if (!bingo) {
        for (int j = 0; j < 3; j++) {
            set<int> col;
            for (int i = 0; i < 3; i++) {
                col.insert(A[i][j]);
            }
            if (col.size() == b.size()) {
                bingo = true;
                break;
            }
        }
    }

    // Check diagonals
    if (!bingo) {
        set<int> diagonal1;
        set<int> diagonal2;
        for (int i = 0; i < 3; i++) {
            diagonal1.insert(A[i][i]);
            diagonal2.insert(A[i][2 - i]);
        }
        if (diagonal1.size() == b.size() || diagonal2.size() == b.size()) {
            bingo = true;
        }
    }

    cout << (bingo ? "Yes" : "No") << endl;

    return 0;
}
